import "../Styles/Media-Queries.css";
import "../Styles/Media-Queries.css";
import Redes from "../Components/Footer/Redes";
const Menu = ()=>{
    return(
        <main className="main-home">
            <section className="presentation-container">
                <h1>Gehiner Ferley Sierra Rinc&oacute;n</h1>
                <h2 className="presentation-container__subtitle">Hola a todos soy Front-end Developer</h2>
                <Redes/>
            </section>
            <section className="CV-options">
                <a href="/proyects">
                    <img src="https://i.ibb.co/6XXK7YX/web.webp" alt="Icono de Proyectos" />
                    <h2>Portafolio</h2>
                </a>
                <a href="/skills">
                    <img src="https://i.ibb.co/rM9v2ZZ/desarrollo-de-habilidades.webp" alt="Icono de Habilidades" />
                    <h2>Habilidades</h2>
                </a>
                <a href="/experience">
                    <img src="https://i.ibb.co/GsrJd1N/sitio-web.webp" alt="Icono de Experiencia" />
                    <h2>Experiencia</h2>
                </a>
            </section>
        </main>
    )
};

export default Menu;
